import React from 'react';

const Header = () => {
  return (
    <header className="bg-white shadow-sm sticky-top">
      <div className="container">
        <nav className="navbar navbar-expand-lg navbar-light py-3">
          <div className="navbar-brand d-flex align-items-center">
            <div className="logo-container me-3">
              <i className="fas fa-sticky-note text-primary fs-2"></i>
            </div>
            <div>
              <h2 className="mb-0 fw-bold text-primary">Keeper</h2>
              <small className="text-muted">Your Digital Notes</small>
            </div>
          </div>
          
          <div className="navbar-nav ms-auto d-none d-lg-flex">
            <div className="nav-item d-flex align-items-center">
              <span className="badge bg-primary rounded-pill px-3 py-2">
                <i className="fas fa-lightbulb me-2"></i>
                Smart Notes
              </span>
            </div>
          </div>
        </nav>
      </div>
      
      <div className="header-decoration">
        <div className="wave-container">
          <svg viewBox="0 0 1200 120" preserveAspectRatio="none" className="wave">
            <path d="M0,0V46.29c47.79,22.2,103.59,32.17,158,28,70.36-5.37,136.33-33.31,206.8-37.5C438.64,32.43,512.34,53.67,583,72.05c69.27,18,138.3,24.88,209.4,13.08,36.15-6,69.85-17.84,104.45-29.34C989.49,25,1113-14.29,1200,52.47V0Z" opacity=".25" className="shape-fill"></path>
            <path d="M0,0V15.81C13,36.92,27.64,56.86,47.69,72.05,99.41,111.27,165,111,224.58,91.58c31.15-10.15,60.09-26.07,89.67-39.8,40.92-19,84.73-46,130.83-49.67,36.26-2.85,70.9,9.42,98.6,31.56,31.77,25.39,62.32,62,103.63,73,40.44,10.79,81.35-6.69,119.13-24.28s75.16-39,116.92-43.05c59.73-5.85,113.28,22.88,168.9,38.84,30.2,8.66,59,6.17,87.09-7.5,22.43-10.89,48-26.93,60.65-49.24V0Z" opacity=".5" className="shape-fill"></path>
            <path d="M0,0V5.63C149.93,59,314.09,71.32,475.83,42.57c43-7.64,84.23-20.12,127.61-26.46,59-8.63,112.48,12.24,165.56,35.4C827.93,77.22,886,95.24,951.2,90c86.53-7,172.46-45.71,248.8-84.81V0Z" className="shape-fill"></path>
          </svg>
        </div>
      </div>
      
      <style jsx>{`
        .header-decoration {
          position: relative;
          height: 60px;
          overflow: hidden;
          background: linear-gradient(135deg, var(--primary-color) 0%, var(--secondary-color) 100%);
        }
        
        .wave-container {
          position: absolute;
          bottom: 0;
          left: 0;
          width: 100%;
          overflow: hidden;
          line-height: 0;
        }
        
        .wave {
          position: relative;
          display: block;
          width: calc(100% + 1.3px);
          height: 60px;
        }
        
        .shape-fill {
          fill: #FFFFFF;
        }
        
        .logo-container {
          position: relative;
        }
        
        .logo-container::before {
          content: '';
          position: absolute;
          top: -5px;
          left: -5px;
          right: -5px;
          bottom: -5px;
          background: linear-gradient(45deg, var(--primary-color), var(--accent-color));
          border-radius: 50%;
          opacity: 0.1;
          z-index: -1;
        }
        
        @media (max-width: 768px) {
          .navbar-brand h2 {
            font-size: 1.5rem;
          }
          
          .header-decoration {
            height: 40px;
          }
          
          .wave {
            height: 40px;
          }
        }
      `}</style>
    </header>
  );
};

export default Header;
